define("tpl/calendar",[],function(require,t,n){n.exports='<section id="calendar">\n<div id="topBarBox" class="topBar">\n    <div class="returnBtn calendarBack">\n        <div class="returnBtnBox">\n        </div>\n    </div>\n    <h1 class="pageTitle">日期选择</h1>\n</div>\n<%\n    var selected = data.selected,\n        year = selected.getFullYear(),\n        month = selected.getMonth(),\n        dayOfStart = 0,\n        today = new Date((new Date()).setHours(0, 0, 0, 0)),\n        start = new Date(year, month, 1, 0, 0, 0, 0),\n        headers = data.weekDay,\n        dates = [],\n        date = start;\n    for (var i = dayOfStart; i > 0; i--) {\n        var head = headers.unshift();\n        headers.push(head);\n    }\n    for (var i = start.getDay(); i > 0; i--) {\n        dates.push(null);\n    }\n    while(date.getMonth() === month) {\n        dates.push(new Date(date));\n        date.setDate(date.getDate() + 1);\n    }\n%>\n<div class="calendar jsCalendar">\n    <ul class="calButtonBar">\n        <li class="calPrevious"><span>&lt;</span></li>\n        <li class="calMonth"><%=(month + 1)%>月 <%=year%></li>\n        <li class="calNext"><span>&gt;</span></li>\n    </ul>\n    <div class="calGrid">\n        <table>\n        <tbody>\n        <tr class="">\n        <% for (var i = 0; i < 7; i++) { %>\n            <th><%=headers[i]%></th>\n        <% } %>\n        </tr>\n        <%\n            var rows = Math.ceil(dates.length / 7),\n                index = 0;\n            for (var i = 0; i < rows; i++) {\n        %>\n        <tr>\n        <%\n            for (var j = 0; j < 7; j++) { \n                var clazz = \'date\',\n                    date = null;\n                if (index < dates.length) {\n                    date = dates[index];\n                }\n                if (date) {\n                    if (date < today) {\n                        clazz += \' inactive\';\n                    } else {\n                        clazz += \' active\';\n                        if (date.getTime() === today.getTime()) {\n                            clazz += \' today\';\n                        }\n                    }\n                    if (date === selected) {\n                        clazz += \' startDate\';\n                    }\n                }\n        %>\n            <td>\n                <a class="<%=clazz%>" data-date="<%=(date ? date.getTime() : \'\')%>">\n                    <%=(date ? date.getDate() : \'\')%>\n                </a>\n            </td>\n        <% \n                index++;\n            }\n        %>\n        </tr>\n        <%\n            }\n        %>\n        </tbody>\n        </table>\n    </div>\n</div>\n</section>'});;
